import React from "react";
import "./Footer.css";
import Git from "../../assets/github.png";
import Insta from "../../assets/instagram.png";
import Linkedin from "../../assets/linkedin.png";

function Footer(){
    return(
        <div className="footer">
            <hr/>
            <div>
                <img src={Git}/>
                <img src={Insta}/>
                <img src={linkedin}/>
            </div>
        </div>
    )
}
export default Footer;
